import React, { useEffect, useState, useContext, useCallback } from 'react';
import { getQuestions, submitTest } from '../api'; // Import submitTest from api
import { useNavigate } from 'react-router-dom';
import { UserContext } from '../context/UserContext';

const Test = () => {
    const { currentUser } = useContext(UserContext);
    const [questions, setQuestions] = useState([]);
    const [userAnswers, setUserAnswers] = useState({});
    const [error, setError] = useState('');
    const [loading, setLoading] = useState(true);
    const [timer, setTimer] = useState(900);
    const [score, setScore] = useState(null);
    const navigate = useNavigate();

    // Handle submit score
    const handleSubmitScore = useCallback(async () => {
        // Calculate the total score based on correct answers
        const correctAnswers = questions.filter((question) => 
            question.correctAnswer === userAnswers[question.id]
        ).length;

        const calculatedScore = correctAnswers;

        const userId = parseInt(currentUser.id, 10);

        try {
            const result = await submitTest({ userId, score: calculatedScore, userAnswers, questions });
            console.log(result);

            setScore(calculatedScore); // Set the score in the state

            // Navigate to the score page and pass the score, answers, and questions
            navigate('/score', { state: { score: calculatedScore, userId, userAnswers, questions } });
        } catch (error) {
            console.error('Error submitting score:', error);
        }
    }, [questions, userAnswers, currentUser, navigate]);

    useEffect(() => {
        const fetchQuestions = async () => {
            try {
                const response = await getQuestions();
                if (response && response.questions && response.questions.length > 0) {
                    setQuestions(response.questions);
                } else {
                    setError('No questions available');
                }
            } catch (err) {
                console.error('Failed to fetch questions:', err);
                setError('Failed to fetch questions');
            } finally {
                setLoading(false);
            }
        };

        fetchQuestions();
    }, []);

    useEffect(() => {
        const countdown = setInterval(() => {
            setTimer((prevTimer) => {
                if (prevTimer <= 1) {
                    clearInterval(countdown);
                    handleSubmitScore(); // Submit score when time runs out
                    return 0;
                }
                return prevTimer - 1;
            });
        }, 1000);

        return () => clearInterval(countdown);
    }, [handleSubmitScore]);

    const handleAnswerChange = (questionId, answer) => {
        setUserAnswers((prevAnswers) => ({
            ...prevAnswers,
            [questionId]: answer, // Ensure the selected answer is stored correctly by questionId
        }));
    };

    if (loading) {
        return <div>Loading questions...</div>;
    }

    if (error) {
        return <div>{error}</div>;
    }

    return (
        <div>
            <h2>Time Left: {Math.floor(timer / 60)}:{String(timer % 60).padStart(2, '0')}</h2>
            {questions.map((question, index) => (
                <div key={question.id}>
                    <h4>{question.text}</h4>
                    <div>
                        <input 
                            type="radio" 
                            name={`question${index}`} 
                            value="1" 
                            onChange={() => handleAnswerChange(question.id, '1')} 
                        /> {question.option1}<br />
                        <input 
                            type="radio" 
                            name={`question${index}`} 
                            value="2" 
                            onChange={() => handleAnswerChange(question.id, '2')} 
                        /> {question.option2}<br />
                        <input 
                            type="radio" 
                            name={`question${index}`} 
                            value="3" 
                            onChange={() => handleAnswerChange(question.id, '3')} 
                        /> {question.option3}<br />
                        <input 
                            type="radio" 
                            name={`question${index}`} 
                            value="4" 
                            onChange={() => handleAnswerChange(question.id, '4')} 
                        /> {question.option4}<br />
                    </div>
                </div>
            ))}
            <button onClick={handleSubmitScore}>Submit Test</button>
            {score !== null && <h3>Your Score: {score}</h3>}
        </div>
    );
};

export default Test;
